"""# **Creating TF-IDF Vector by removing stopwords and tokenizing the text**
A High weight in **TF-IDF** is reached by a high term frequency(in the given document) and a low document frequency of the term in the whole collection of documents.

**TF-IDF** algorithm is made of *2* algorithms multiplied together.

## **Term Frequency**

Term frequency (TF) is how often a word appears in a document, divided by how many words there are.
TF(t) = (Number of times term t appears in a document) / (Total number of terms in the document)

      tf(t,d) = log(F(t,d))

## **Inverse document frequency**
 
Term frequency is how common a word is, inverse document frequency (IDF) is how unique or rare a word is.
  
      idf(t,D) = log(N/Nt∈d)
 
## **TF-IDF**
     tf-idf(t,d,D) = tf(t,d) . idf(t,D)

"""

def simple_tokenizer(text):
    #tokenizing the words:
    words = word_tokenize(text)
    #converting all the tokens to lower case:
    words = map(lambda word: word.lower(), words)
    #let's remove every stopwords
    words = [word for word in words if word not in stopWords]
    #stemming all the tokens
    tokens = (list(map(lambda token: PorterStemmer().stem(token), words)))
    ntokens = list(filter(lambda token : charfilter.match(token),tokens))
    return ntokens

tf_idf_vector = TfidfVectorizer(tokenizer = simple_tokenizer, max_features = 1000, norm = 'l2')

